import Vue, { VueConstructor } from 'vue';
import headerComponent      from '@/components/header/Header.vue';
import headerSellerComponent from '@/components/HeaderSeller/HeaderSeller.vue';
import footerComponent      from '@/components/footer/Footer.vue';
import aguardandoEnvio      from '@/components/box/aguardandoEnvio/AguardandoEnvio.vue';
import notification         from '@/components/notification/Notification.vue';
import region               from '@/components/regionComponent/Region.vue';
import visaoGeral           from '@/components/box/visaoGeral/VisaoGeral.vue';
import meuNegocio           from '@/components/meuNegocio/MeuNegocio.vue';
import Produtos             from '@/components/meuNegocio/produtos/produtos.vue';
import ProductModal         from '@/components/product-modal/ProductModal.vue';
import Negocio              from '@/components/meuNegocio/negocio/negocio.vue';
import overview             from '@/components/meuNegocio/overview/overview.vue';
import orders               from '@/components/meuNegocio/orders/orders.vue';
import orderItem            from '@/components/meuNegocio/orders/order-item/order-item.vue';
import editarMeuNegocio     from '@/components/box/editarMeuNegocio/EditarMeuNegocio.vue';
import loadingComponent     from '@/components/loading/Loading.vue';
import ordersNumber         from '@/components/box/orders/OrdersNumber.vue';
import horarioAtendimento   from '@/components/box/horarioAtendimento/HorarioAtendimento.vue';
import Frete                from '@/components/box/Frete/Frete.vue';
import accordion            from '@/components/accordion/Accordion.vue';
import NewsNotification     from '@/components/newsNotification/NewsNotification.vue';
import ProgressBar          from '@/components/progressbar/ProgressBar.vue';
import modal                from '@/components/modal/Modal.vue';
import orderList            from '@/components/meuNegocio/orders/order-list/order-list.vue';
import Tracking             from '@/components/orders/tracking/Tracking.vue';
import CategoryDelete       from '@/components/category-modal/category-delete/CategoryDelete.vue';
import CategoryConfirmEditVariant from '@/components/category-modal/category-confirm-edit-variant/CategoryConfirmEditVariant.vue';
import CategoryModal        from '@/components/category-modal/CategoryModal.vue';
import ImportProductsModal        from '@/components/import-products/import-products-modal.vue';

import HelpButton           from '@/components/help-button/HelpButton.vue';
import AvaliationModal      from '@/components/avaliation/AvaliationModal.vue';

import ProductPublished     from '@/components/product-modal/product-published/ProductPublished.vue';
import ProductDelete        from '@/components/product-modal/product-delete/ProductDelete.vue';
import ProductImport        from '@/components/product-modal/product-import/ProductImport.vue';
import ProductCloseModal    from '@/components/product-modal/product-close-modal/ProductCloseModal.vue';
import ProductImageCropper  from '@/components/product-modal/product-image-cropper/ProductImageCropper.vue';
import ProductImageImport   from '@/components/product-modal/product-image-import/ProductImageImport.vue';
import ProductImageEdit     from '@/components/product-modal/product-image-edit/ProductImageEdit.vue';

import StepFive             from '@/components/register-seller/steps-form/step-five/StepFive.vue';
import StepFour             from '@/components/register-seller/steps-form/step-four/StepFour.vue';
import StepOne              from '@/components/register-seller/steps-form/step-one/StepOne.vue';
import StepThree            from '@/components/register-seller/steps-form/step-three/StepThree.vue';
import StepTwo              from '@/components/register-seller/steps-form/step-two/StepTwo.vue';
import InputForm            from '@/components/register-seller/input-form/InputForm.vue';
import ActionsForm          from '@/components/register-seller/actions-form/ActionsForm.vue';
import StepsViewForm        from '@/components/register-seller/steps-view-form/StepsViewForm.vue';
import OptIn                from '@/components/register-seller/opt-in/OptIn.vue';
import VerificationCode     from '@/components/register-seller/verification-code/VerificationCode.vue';
import MapAddress           from '@/components/register-seller/map-address/MapAddress.vue';
import LoginForm            from '@/components/register-seller/login-form/LoginForm.vue';
import loginView            from '@/views/Login/Login.vue';

export function registerVueGlobalComponent(vue: VueConstructor<Vue>) {
    [
        { component: headerComponent, selector: 'Header' },
        { component: headerSellerComponent, selector: 'HeaderSeller' },
        { component: footerComponent, selector: 'Footer' },
        { component: aguardandoEnvio, selector: 'aguardandoEnvio' },
        { component: notification, selector: 'notification' },
        { component: visaoGeral, selector: 'visaoGeral' },
        { component: region, selector: 'regionComponent' },
        { component: meuNegocio, selector: 'meuNegocio' },
        { component: Negocio, selector: 'negocio' },
        { component: editarMeuNegocio, selector: 'editarMeuNegocio' },
        { component: loadingComponent, selector: 'loading' },
        { component: ordersNumber, selector: 'ordersNumber' },
        { component: horarioAtendimento, selector: 'horarioAtendimento' },
        { component: Frete, selector: 'Frete' },
        { component: accordion, selector: 'accordion' },
        { component: NewsNotification, selector: 'newsNotification' },
        { component: ProgressBar, selector: 'progressbar' },
        { component: modal, selector: 'modal' },
        { component: overview, selector: 'overview' },
        { component: orders, selector: 'orders' },
        { component: orderList, selector: 'order-list' },
        { component: Tracking, selector: 'tracking' },
        { component: orderItem, selector: 'orderItem'},

        { component: CategoryModal, selector: 'categoryModal'},
        { component: CategoryDelete, selector: 'categoryDelete'},
        { component: CategoryConfirmEditVariant, selector: 'categoryConfirmEditVariant'},

        { component: ImportProductsModal, selector: 'importProductsModal'},

        { component: Produtos, selector: 'produtos' },
        { component: ProductModal, selector: 'productModal' },
        { component: ProductDelete, selector: 'productDelete' },
        { component: ProductCloseModal, selector: 'productCloseModal'},
        { component: ProductPublished, selector: 'productPublished' },
        { component: ProductImport, selector: 'productImport' },
        { component: ProductImageEdit, selector: 'productEditImage' },
        { component: ProductImageImport, selector: 'productImportImage' },
        { component: ProductImageCropper, selector: 'productCropperImage' },

        { component: StepOne, selector: 'step-one' },
        { component: StepTwo, selector: 'step-two' },
        { component: StepThree, selector: 'step-three' },
        { component: StepFour, selector: 'step-four' },
        { component: StepFive, selector: 'step-five' },
        { component: InputForm, selector: 'input-form' },
        { component: ActionsForm, selector: 'actions-form' },
        { component: StepsViewForm, selector: 'steps-view-form' },
        { component: OptIn, selector: 'opt-in' },
        { component: VerificationCode, selector: 'verification-code'},
        { component: LoginForm, selector: 'login-form'},
        { component: MapAddress, selector: 'map-address'},

        { component: loginView, selector: 'login'},

        { component: HelpButton, selector: 'help-button'},
        { component: AvaliationModal, selector: 'avaliation-modal'},

    ].forEach(config => vue.component(config.selector, config.component));
}
